■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>ビルや校舎のコンクリート壁面の防汚対策に。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5285/5344bt-01.jpg" width="600" height="1102"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">◆使用方法<br>1.すでに汚れているか、コケが付着している場合は、酸性洗剤で洗浄し、完全に乾燥させてください。又、コンクリート灰液(エフロ)が付着している場合は、市販のコンクリート灰液除去剤で除去し、完全に乾燥させてください。<br>2.その後染み込み防止用の「油性シーラー」を刷毛で塗布し、乾燥させてください。<br>3.「モスノン」を別の新しい刷毛で塗布してください。<br>※防汚効果が落ちてきましたら、塗布面をキレイに洗浄し、完全に乾燥させてから、そのまま「モスノン」を上塗りしてください。(上塗りの場合は、「油性シーラー」による下地処理は不要です。)<br><br>◆使用上の注意<br>・床面には使用しないでください。滑る原因となるので、ご注意ください。<br>・火気厳禁。火の気のある場所で絶対に使用しないでください。<br>・液が目に入らないよう注意してください。万一、目に入った場合は15分以上流水で洗眼し、その後医師にご相談ください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="503" height="741" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5285/5344bt-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="424" height="633" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5285/5344bt-03.jpg"><br><font size="3">※弊社=(株)ニーズインターナショナル</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">「モスノン」は、コンクリートの塀や自然石塀等に塗布することで、苔汚れや雨による窓枠下の黒ずみ汚れやサビ汚れ等の付着を防止するコーティング剤です。塗布面は見た目がほとんど変わらず、自然な仕上がりになります</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常納期より3～6日ほど日数が掛かる場合がございます。■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">「モスノン」は、コンクリートの塀や自然石塀等に塗布することで、苔汚れや雨による窓枠下の黒ずみ汚れやサビ汚れ等の付着を防止するコーティング剤です。塗布面は見た目がほとんど変わらず、自然な仕上がりになります</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">1L</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：5×12×20cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：1300g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">シリコーン、変性オイル、剥離剤</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">塗布可能範囲:約16.5平米(5坪)<br>無色透明液体<br>消防法:第四類 第一石油類非水溶性液体</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常より3～6日ほど日数が掛かる場合がございます。・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
